import React, { useEffect, useState } from 'react';
import axios from 'axios';

const HomePage = () => {
  const [prices, setPrices] = useState({});

  useEffect(() => {
    // Fetch iPhone 13 prices from backend
    const fetchPrices = async () => {
      try {
        const response = await axios.get('/api/iphone-13-prices');
        setPrices(response.data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchPrices();
  }, []);

  return (
    <div>
      <h1>iPhone 13 Prices</h1>
      <ul>
        <li>Trendyol: {prices.trendyolPrice}</li>
        <li>Hepsiburada: {prices.hepsiburadaPrice}</li>
        <li>Amazon: {prices.amazonPrice}</li>
      </ul>
    </div>
  );
};

export default HomePage;
